INSERT INTO `tbl_loker` VALUES (5, 'Lowongan Kerja Sales Account Manager IT', '<div style=\"color: rgb(102, 102, 102); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: 0.1px;\"><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px;\"><span style=\"font-weight: 600; letter-spacing: 0.1px;\">Tanggung Jawab Pekerjaan :</span></p></div><div style=\"color: rgb(102, 102, 102); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: 0.1px;\"><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px;\"> Must achieve target of selling.<br> Be responsible for prospecting, identifying and establishing new clients.<br> Develop a sales pipeline to support future sales and business planning.<br> Plan and execute sales strategies to achieve the business objective which include sales plan to meet current clients profile and needs, as well as actively involved in preparation of tenders, proposals and quotations for clients.</p></div><h5 style=\"font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(102, 102, 102); margin-top: 12px; margin-bottom: 12px; font-size: 16px; letter-spacing: 0.1px;\">Syarat Pengalaman :</h5><div style=\"color: rgb(102, 102, 102); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: 0.1px;\">Minimal of 2 years</div><h5 style=\"font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(102, 102, 102); margin-top: 12px; margin-bottom: 12px; font-size: 16px; letter-spacing: 0.1px;\">Keahlian :</h5><div style=\"color: rgb(102, 102, 102); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: 0.1px;\"><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px;\"> Good knowledge of IT Products<br> Experience in MS SharePoint would be considered as a plus point<br> Actively seeks out for new clients.</p></div><h5 style=\"font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(102, 102, 102); margin-top: 12px; margin-bottom: 12px; font-size: 16px; letter-spacing: 0.1px;\">Kualifikasi :</h5><div style=\"color: rgb(102, 102, 102); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: 0.1px;\"><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px;\">1. Male/Female.<br>2. Able to work independently or in a team.<br>3. Fluent in English (verbal and written).<br>4. Sales target achievement.<br>5. Strong leadership, good interpersonal and communication skill.<br>6. Hardworking, business travel and able to work under time pressure.</p></div><h5 style=\"font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(102, 102, 102); margin-top: 12px; margin-bottom: 12px; font-size: 16px; letter-spacing: 0.1px;\">Tunjangan :</h5><div style=\"color: rgb(102, 102, 102); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: 0.1px;\"><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px;\">Meals &amp; Transport</p></div><h5 style=\"font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(102, 102, 102); margin-top: 12px; margin-bottom: 12px; font-size: 16px; letter-spacing: 0.1px;\">Insentif :</h5><div style=\"color: rgb(102, 102, 102); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: 0.1px;\"><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px;\"> Interesting selling comission &amp; bonus,<br> Yearly Bonus,</p></div><h5 style=\"font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(102, 102, 102); margin-top: 12px; margin-bottom: 12px; font-size: 16px; letter-spacing: 0.1px;\">Waktu Bekerja :</h5><div style=\"color: rgb(102, 102, 102); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: 0.1px;\">Monday  Friday, 08.30  17.30</div>', 'Sarjana (S1)', 4000000, 'Karyawan Tetap', '2021-07-05', '2021-07-26');

